<!DOCTYPE html>
<html lang="en">
<head>
	<meta charset="UTF-8">
	<title>Welcome</title>
	<script type="text/javascript" src="external/jquery-3.2.1/jquery-3.2.1.js"></script>
	<script type="text/javascript" src="external/bootstrap-3.3.7-dist/js/bootstrap.min.js"></script>
	<link rel="stylesheet" type="text/css" href="external/bootstrap-3.3.7-dist/css/bootstrap.min.css">
	<link rel="stylesheet" type="text/css" href="css/style.css">
</head>
<body>
	<div id="[HTMLElement_id]" class="[HTMLElement_className]">
		<div id="[HTMLElement_aboutMeContainerId]" class="[HTMLElement_aboutMeContainerClass]">
			<h3 id="[HTMLElement_aboutMeTitleId]" class="[HTMLElement_aboutMeTitleClass]">[HTMLElement_aboutMeTitleText]</h3>
			<p id="[HTMLElement_aboutMeParagraphId]" class="[HTMLElement_aboutMeParagraphClass]">[HTMLElement_aboutMeParagraphText]</p>
		</div>
		<div id="[HTMLElement_contactMainImageContainerId]" class="[HTMLElement_contactMainImageContainerClass]">
			<img id="[HTMLElement_contactMainImageId]" src="[HTMLElement_contactMainImageSrc]" alt="[HTMLElement_contactMainImageAlt]" class="[HTMLElement_contactMainImageClass]">
		</div>
		<div id="[HTMLElement_contactSocialContainerId]" class="[HTMLElement_contactSocialContainerClass]">
			<h3 id="[HTMLElement_contactSocialTitleId]" class="[HTMLElement_contactSocialTitleClass]">[HTMLElement_contactSocialTitleText]</h3>
			<div id="[HTMLElement_contactPhoneContainerId]" class="[HTMLElement_contactPhoneContainerClass]">
				<img id="[HTMLElement_contactPhoneImageId]" src="[HTMLElement_contactPhoneImageSrc]" alt="[HTMLElement_contactPhoneImageAlt]" class="[HTMLElement_contactPhoneImageClass]">
				<p id="[HTMLElement_contactPhoneParagraphId]" class="[HTMLElement_contactPhoneParagraphClass]">[HTMLElement_contactPhoneParagraphText]</p>
			</div>
			<div id="[HTMLElement_contactEmailContainerId]" class="[HTMLElement_contactEmailContainerClass]">
				<img id="[HTMLElement_contactEmailImageId]" src="[HTMLElement_contactEmailImageSrc]" alt="[HTMLElement_contactEmailImageAlt]" class="[HTMLElement_contactEmailImageClass]">
				<p id="[HTMLElement_contactEmailParagraphId]" class="[HTMLElement_contactEmailParagraphClass]">[HTMLElement_contactEmailParagraphText]</p>
			</div>
			<div id="[HTMLElement_contactTwitterContainerId]" class="[HTMLElement_contactTwitterContainerClass]">
				<img id="[HTMLElement_contacTwitterImageId]" src="[HTMLElement_contacTwitterImageSrc]" alt="[HTMLElement_contacTwitterImageAlt]" class="[HTMLElement_contacTwitterImageClass]">
			</div>
			<div id="[HTMLElement_contactOthersContainerId]" class="[HTMLElement_contactOthersContainerClass]">
				<img id="[HTMLElement_contacFacebookImageId]" src="[HTMLElement_contacFacebookImageSrc]" alt="[HTMLElement_contacFacebookImageAlt]" class="[HTMLElement_contacFacebookImageClass]">
				<img id="[HTMLElement_contacInstagramImageId]" src="[HTMLElement_contacInstagramImageSrc]" alt="[HTMLElement_contacInstagramImageAlt]" class="[HTMLElement_contacInstagramImageClass]">
			</div>
		</div>
	</div>
</body>
</html>
